import {Swiper,SwiperSlide,useSwiper} from 'swiper/react'
import "swiper/css"
import "./Services.css";
import data from '../../utils1/slider.json'
import { sliderSettings } from '../../utils1/common';

const Services = () => { 
    console.log(Swiper)
  return (
    <section >
        <div className='paddings innerWidth conatiner '>
        <p className='s-heading'> Select Your Food From Mutliple restaurants and Different Categories  </p>
        <Swiper {...sliderSettings}>
               {
                   data.map((card,i)=>(

                              <SwiperSlide key={i}  >
                                            <div className='card'>
                                               <img src={card.image} alt="immmmmm g"/>
                                            </div>
                              </SwiperSlide>


                   ))
               }
               
        </Swiper>
        </div>
    </section>
  )
}

export default Services
